local organizeBlips = {}

local findBlipNameFromID = function(ID)
    for id, v in pairs(__GLOBAL.blip_settings.blips_name) do
        if id == ID then return v end
    end
end

local findBlipPositionFromName = function(name, blipid)
    local styl = __GLOBAL.blip_settings.type
    if styl == 'element' then
        local positions = {}
        local position = {}
        local element = __GLOBAL.blip_settings.element
        
        for _, blip in pairs(getElementsByType('blip')) do
            local __blipID = getBlipIcon(blip)
            local __name = getElementData(blip, element) or nil
            if __blipID == blipid then
                positions[#positions + 1] = {__name, {getElementPosition(blip)}}
            end
        end

        for _, data in pairs(positions) do
            if data[1] == name then
                position[#position + 1] = data[2]
            end
        end
        return position
    else
        local count = 1
        local position = {}
        for _, blip in pairs(getElementsByType('blip')) do
            local __blipID = getBlipIcon(blip)
            if __blipID ~= 0 then
                local name = __GLOBAL.blip_settings.blips_name[blipID]
                if __blipID == blipid then
                    position[count] = {getElementPosition(blip)}
                    count = count + 1
                end
            end
        end
        return position
    end
end

local verifyBlipsAvailable = function(blipID)
    local result = true
    for _, info in pairs(__GLOBAL.interface.filters) do for _, data in pairs(info.blip_ids) do
        if info.state then
            if data == blipID then result = true end
        else
            if data == blipID then result = false end
        end
    end end
    return result
end

addEvent('upcodes > update blips', true)
addEventHandler('upcodes > update blips', root,
    function()
        organizeBlips = {}

        local styl = __GLOBAL.blip_settings.type
        if styl == 'element' then
            local no_repeat = {}
            local element = __GLOBAL.blip_settings.element
            for _, blip in pairs(getElementsByType('blip')) do
                local blipID = getBlipIcon(blip)
                local name = getElementData(blip, element) or 'Blip ID:'..blipID..' invalid element'
                if blipID ~= 0 and not no_repeat[blipID .. '' .. name] then
                    no_repeat[blipID .. '' .. name] = true
                    local positions = findBlipPositionFromName(name, blipID)
                    organizeBlips[#organizeBlips + 1] = {
                        blipID = blipID,
                        name = name or 'Invalid blip name',
                        positions = positions
                    }
                end
            end
        else
            local no_repeat = {}
            local element = __GLOBAL.blip_settings.element
            for _, blip in pairs(getElementsByType('blip')) do
                local blipID = getBlipIcon(blip)
                local state = verifyBlipsAvailable(blipID)
                if state and blipID ~= 0 then
                    if not no_repeat[blipID] then
                        no_repeat[blipID] = true
                        organizeBlips[#organizeBlips + 1] = {
                            blipID = blipID,
                            name = __GLOBAL.blip_settings.blips_name[blipID] or 'Invalid blip name',
                            positions = findBlipPositionFromName(_, blipID)
                        }
                    end
                end
            end
        end

        __GLOBAL.blips_bigmap = organizeBlips
    end
)

