function calculatePath(db, nodeFrom, nodeTo, player, __distance)
    if not nodeTo or not nodeFrom then return end 
    if nodeTo.z < 1 then return end

    local next = next
    
    local g = { [nodeFrom] = 0 }		
    local hcache = {}					
    local parent = {}					
    local openheap = MinHeap.new()
    
    local function h(node)
        if hcache[node] then
            return hcache[node]
        end
        local x, y, z = node.x - nodeTo.x, node.y - nodeTo.y, node.z - nodeTo.z
        hcache[node] = x*x + y*y + z*z
        return hcache[node]
    end
    local nodeMT = {
        __lt = function(a, b)
            return g[a] + h(a) <  g[b] + h(b)
        end,
        __le = function(a, b)
            if not g[a] or not g[b] then
                outputConsole(debug.traceback())
            end
            return g[a] + h(a) <= g[b] + h(b)
        end
    }
    setmetatable(nodeFrom, nodeMT)
    openheap:insertvalue(nodeFrom)
    
    local current
    while not openheap:empty() do
        
        
        current = openheap:deleteindex(0)
        if current == nodeTo then
            break
        end
        
        
        for id,distance in pairs(current.neighbours) do
            local successor = getNodeByID(db, id)
            local successor_g = g[current] + distance*distance
            if not g[successor] or g[successor] > successor_g then
                setmetatable(successor, nodeMT)
                
                local calculePath = getDistanceBetweenPoints3D(nodeFrom.x, nodeFrom.y, nodeFrom.z, successor.x, successor.y, successor.z)
                if calculePath > ( __distance or 500) then
                    local path = {}
                    repeat
                        table.insert(path, 1, current)
                        current = parent[current]
                    until not current
                    return path
                end
                
                g[successor] = successor_g
                openheap:insertvalue(successor)
                parent[successor] = current
            end
        end
    end
    
    if current == nodeTo then
        local path = {}
        repeat
            table.insert(path, 1, current)
            current = parent[current]
        until not current
        return path
    else
        return false
    end
end

