-- MINIMAP PRE-RENDER EFFECTS

local __minimapPreRender = function(slice)
    for id, response in pairs(__FX) do
        if __FX[id][1] ~= __FX[id][2] then
            __FX[id][1] = __FX[id][1] + (__FX[id][2] - __FX[id][1]) * slice * 0.005
        end
    end
end

-- MINIMAP TARGET RADAR

local __minimapTarget = function(state)
    
    local __minimap = function()
        if __CLOSE_MINIMAP_EXPORTS then return end
        if not __CLOSE_MINIMAP then return end

        local _, _, pRotation = getElementRotation(localPlayer)
        local cX, cY, _, fX, fY = getCameraMatrix()
        local cRotate = math.deg(math.atan2(fY - cY, fX - cX)) + 360 + 90

        dxSetRenderTarget(__MINIMAP_TARGET, true)

            __functions.rectangle(false, 
                0, 0, __MINIMAP_SIZE[1], __MINIMAP_SIZE[2],
                __GLOBAL.interface.default_settings.water_color
            )

            if __MINIMAP_STYLE == '3D' then
                dxSetShaderTransform(__MINIMAP_SHADER_3D, 0, -45, cRotate - 180)
    
                __functions.image(false,
                    __MINIMAP_SIZE[1] / 2 - (__MINIMAP_SIZE[1] * 2),
                    __MINIMAP_SIZE[2] / 2 - (__MINIMAP_SIZE[2] * 2) + 60,
                    __MINIMAP_SIZE[1] * 4, __MINIMAP_SIZE[2] * 4,
                    __MINIMAP_SHADER_3D
                )
            else
                __functions.image(false,
                    __MINIMAP_SIZE[1] / 2 - __MINIMAP_SIZE[1],
                    __MINIMAP_SIZE[2] / 2 - __MINIMAP_SIZE[2],
                    __MINIMAP_SIZE[1] * 2, __MINIMAP_SIZE[2] * 2,
                    __MINIMAP_MAP_TARGET, cRotate - 180
                )
            end

        dxSetRenderTarget()
    end

    local __assets = function()
        if __CLOSE_MINIMAP_EXPORTS then return end
        if not __CLOSE_MINIMAP then return end

        if __GLOBAL.MAPIMAGE then

            local _, _, pRotation = getElementRotation(localPlayer)
            local cX, cY, _, fX, fY = getCameraMatrix()
            local cRotate = math.deg(math.atan2(fY - cY, fX - cX)) + 360 + 90

            local pPosition = {getElementPosition(localPlayer)}

            local mapSize = {
                __MINIMAP_SIZE[1] * (__MINIMAP_STYLE == '3D' and 4 or 2),
                __MINIMAP_SIZE[2] * (__MINIMAP_STYLE == '3D' and 4 or 2)
            }

            local mPosition = {
                ((pPosition[1] + 3000) / (6000 / __MAP______SIZE)) - (mapSize[1] / __MINIMAP_ZOOM) / 2, 
                ((-pPosition[2] + 3000) / (6000 / __MAP______SIZE)) - (mapSize[2] / __MINIMAP_ZOOM) / 2,
            }

            dxSetRenderTarget(__MINIMAP_MAP_TARGET, true)
                __functions.imagesection(false,
                    0, 0, mapSize[1], mapSize[2], 
                    mPosition[1], mPosition[2], 
                    mapSize[1] / __MINIMAP_ZOOM, mapSize[2] / __MINIMAP_ZOOM, 
                    __GLOBAL.MAPIMAGE
                )
                -- MAP


                -- RADAR AREA
                for _, radararea in pairs(getElementsByType('radararea')) do
                    local rRound = getElementData(radararea, 'upcodes > radar area round') or false
                    local rSize = {getRadarAreaSize(radararea)}
                    local rColor = {getRadarAreaColor(radararea)} local rColor = __functions.rgb2hex(rColor[1], rColor[2], rColor[3])
                    if rSize[1] > 1 and rSize[2] > 1 then
                        local bPosition = {getElementPosition(radararea)}

                        local radarX = mapSize[1] / 2 + (((-pPosition[1] + 3000) / (6000 / __MAP______SIZE)) - ((-bPosition[1] + 3000) / (6000 / __MAP______SIZE))) * __MINIMAP_ZOOM
                        local radarY = mapSize[2] / 2 - (((-pPosition[2] + 3000) / (6000 / __MAP______SIZE)) - ((-bPosition[2] + 3000) / (6000 / __MAP______SIZE))) * __MINIMAP_ZOOM

                        if rRound then
                            __functions.round(false,
                                radarX, radarY - (rSize[1] / (6000 / __MAP______SIZE) * __MINIMAP_ZOOM),
                                (rSize[1] / (6000 / __MAP______SIZE) * __MINIMAP_ZOOM), (rSize[1] / (6000 / __MAP______SIZE) * __MINIMAP_ZOOM), (rSize[1] / (6000 / __MAP______SIZE) * __MINIMAP_ZOOM) / 2, 100, rColor, 0, rColor, 1.5
                            )
                        else
                            __functions.round(false,
                                radarX, radarY - (rSize[2] / (6000 / __MAP______SIZE) * __MINIMAP_ZOOM),
                                (rSize[1] / (6000 / __MAP______SIZE) * __MINIMAP_ZOOM), (rSize[2] / (6000 / __MAP______SIZE) * __MINIMAP_ZOOM), 2.5, 100, rColor, 0, rColor, 1.5
                            )
                        end
                    end
                end


                -- GPS LINES

                local routes = __GLOBAL.LINE_of_GPS or {}
                local __local =  getElementData(radarElementRoute, 'upcodes > map route') or {}
                if __local then
                    for id, response in pairs(routes) do
                        if routes[id + 1] then
                            local GpsX = mapSize[1] / 2 + (((-pPosition[1] + 3000) / (6000 / __MAP______SIZE)) - ((-routes[id][1] + 3000) / (6000 / __MAP______SIZE))) * __MINIMAP_ZOOM
                            local GpsY = mapSize[2] / 2 - (((-pPosition[2] + 3000) / (6000 / __MAP______SIZE)) - ((-routes[id][2] + 3000) / (6000 / __MAP______SIZE))) * __MINIMAP_ZOOM
            
                            local GpsXX = mapSize[1] / 2 + (((-pPosition[1] + 3000) / (6000 / __MAP______SIZE)) - ((-routes[id + 1][1] + 3000) / (6000 / __MAP______SIZE))) * __MINIMAP_ZOOM
                            local GpsYY = mapSize[2] / 2 - (((-pPosition[2] + 3000) / (6000 / __MAP______SIZE)) - ((-routes[id + 1][2] + 3000) / (6000 / __MAP______SIZE))) * __MINIMAP_ZOOM
            

                            dxDrawLine(
                                GpsX,
                                GpsY,
                                GpsXX, 
                                GpsYY,
                                tocolor(__COLORS.gps_line[1], __COLORS.gps_line[2], __COLORS.gps_line[3], 240), __GLOBAL.interface.default_settings.gps.width
                            )

                            if id == (#routes - 1) then
                                dxDrawImage(
                                    GpsXX - (30 / 2),
                                    GpsYY - (30 / 2),
                                    30,
                                    30,
                                    __SVG.arrow, 0, 0, 0, tocolor(__COLORS.gps_line[1], __COLORS.gps_line[2], __COLORS.gps_line[3], 240)
                                )
                            end
                        end
                    end
                end

                -- ARROW
                local arrowSize = {30, 30}

                if __GLOBAL.blip_settings.type == 'element' or __GLOBAL.blip_settings.type == 'game_default' then
                    for _, element in pairs(getElementsByType('blip')) do
                        local bPosition = {getElementPosition(element)}
                        local dist = getDistanceBetweenPoints2D(pPosition[1], pPosition[2], bPosition[1], bPosition[2])
                        if dist < __MINIMAP_LINE_DISTANCE then
                            local bId = getBlipIcon(element)
                            if bId ~= 0 then
    
                                local blipX = mapSize[1] / 2 + (((-pPosition[1] + 3000) / (6000 / __MAP______SIZE)) - ((-bPosition[1] + 3000) / (6000 / __MAP______SIZE))) * __MINIMAP_ZOOM
                                local blipY = mapSize[2] / 2 - (((-pPosition[2] + 3000) / (6000 / __MAP______SIZE)) - ((-bPosition[2] + 3000) / (6000 / __MAP______SIZE))) * __MINIMAP_ZOOM
                
                                __functions.image(false,
                                    blipX - ( (arrowSize[1]) * __MINIMAP_ZOOM ) / 2, blipY - ( (arrowSize[2] * (__MINIMAP_STYLE == '3D' and 1.4 or 1)) * __MINIMAP_ZOOM ) / 2,
                                    (arrowSize[1]) * __MINIMAP_ZOOM, (arrowSize[2] * (__MINIMAP_STYLE == '3D' and 1.4 or 1)) * __MINIMAP_ZOOM, 
                                    'assets/blips/' .. bId .. '.png', 180 - cRotate
                                )
                            end
                        end
                    end
                end


                __functions.image(false,
                    mapSize[1] / 2 + (((-pPosition[1] + 3000) / (6000 / __MAP______SIZE)) - ((-pPosition[1] + 3000) / (6000 / __MAP______SIZE))) * __MINIMAP_ZOOM - ( (arrowSize[1] - 5) * __MINIMAP_ZOOM ) / 2, 
                    mapSize[2] / 2 - (((-pPosition[2] + 3000) / (6000 / __MAP______SIZE)) - ((-pPosition[2] + 3000) / (6000 / __MAP______SIZE))) * __MINIMAP_ZOOM - ( (arrowSize[2] - 5) * __MINIMAP_ZOOM ) / 2,
                    (arrowSize[1] - 5) * __MINIMAP_ZOOM, (arrowSize[2] - 5) * __MINIMAP_ZOOM, 
                    'assets/arrow.png', math.abs(360 - pRotation)
                )
            dxSetRenderTarget()
        end
    end
        
    local peformaceMode = ((__MINIMAP_PEFORMACE_MODE == 'performance' and 20) or (__MINIMAP_PEFORMACE_MODE == 'intermediary' and 10) or (__MINIMAP_PEFORMACE_MODE == 'quality' and 5))

    if state == 1 then
        if isTimer(__minimapTargetTimer) then
            killTimer(__minimapTargetTimer)
            killTimer(__minimapAssetsTimer)
        end

        __minimapTargetTimer = __events.onTimer(__minimap, __MINIMAP_PEFORMACE_TIME or peformaceMode, 0)
        __minimapAssetsTimer = __events.onTimer(__assets, __MINIMAP_PEFORMACE_TIME or peformaceMode * 5, 0)
    else
        if isTimer(__minimapTargetTimer) then
            killTimer(__minimapTargetTimer)
            killTimer(__minimapAssetsTimer)
        end
    end
end

