local __MINIMAP_SETTINGS_MENU = {
    view = false,
    state = false,
}

local __minimapRender = function()

    local view_vehicle = __GLOBAL.interface.default_settings.view_in_vehicle

    if getElementData(localPlayer, 'bloqInterface') then
        return
    end

    if __CLOSE_MINIMAP_EXPORTS then
        __FX.fade[2] = 0
    else
        if __CLOSE_MINIMAP then
            if view_vehicle and not inPreview then
                local inVeh = getPedOccupiedVehicle(localPlayer)
                if inVeh then
                    __FX.fade[2] = 255
                    if not __inVehicle then
                        __inVehicle = true
                    end
                else
                    __FX.fade[2] = 0
                    __inVehicle = false     
                end
            end
        else
            __FX.fade[2] = 0
        end
    end

    if __DICA then
        __DICA = false
        __DICA_TICK = getTickCount()
        __FX.dica[2] = 255
    end

    if __DICA_TICK and (getTickCount() - __DICA_TICK) > 3000 then
        __DICA_TICK = nil
        __FX.dica[2] = 0
    end

    if not __GLOBAL.MAPIMAGE then 
        __GLOBAL.MAPIMAGE = createMAPsvg()
        dxSetTextureEdge(__GLOBAL.MAPIMAGE, 'clamp')
    end
    
    if __FX.fade[1] < 1 then return end
    

    -- RENDER MINIMAP 
    
    __functions.image(false,
        __MINIMAP_POSITION[1], __MINIMAP_POSITION[2], __MINIMAP_POSITION[3], __MINIMAP_POSITION[4],
        __MINIMAP_SHADER, 0, 0, 0, tocolor(255, 255, 255, __FX.fade[1])
    )

    -- SETTINGS MOUSE OVER
    
    if inPreview then return end

    __functions.image(false,
        __MINIMAP_POSITION[1], __MINIMAP_POSITION[2], __MINIMAP_POSITION[3], __MINIMAP_POSITION[4],
        __SVG.__MINIMAP_ROUND_BORDER, 0, 0, 0, tocolor(255, 255, 255, __FX.fade[1])
    )

end

