__events.onEvent('upcodes > minimap open', root,
    function(state)
        if __CLOSE_MINIMAP_EXPORTS then return end

        setPlayerHudComponentVisible('radar', false)
        if state == 1 then
            if not __events.isEvent('onClientRender', root, __minimapRender) then
                DefineOptionsMinimap()
                __events.onPreRender(__minimapPreRender)
                __events.onRender(__minimapRender)
            end
            __CLOSE_MINIMAP = true
            __FX.fade[2] = 255
            __minimapTarget(1)
            triggerEvent('upcodes > generate route', localPlayer, 'minimap', __MINIMAP_LINE_DISTANCE)
        else
            __CLOSE_MINIMAP = false
            __FX.fade[2] = 0
            __minimapTarget(0)
        end
    end
)
