    for id, response in pairs(__GLOBAL.interface.filters) do response.state = true end

    -- CONTROLS CALC

    __GLOBAL.interface.controls.controls_width = {
        width = 0,
        positions = {}
    }

    local controls_width = __GLOBAL.interface.controls.controls_width

    for id, response in pairs(__GLOBAL.interface.controls) do
        
        if response.title and response.sub_text then
            local titleWidth = dxGetTextWidth ( response.title, 1, __fonts.use('settings', 19))
            local textWidth = dxGetTextWidth ( response.sub_text, 1, __fonts.use('settings', 19))
            
            controls_width.width = controls_width.width + (titleWidth + textWidth) + 22.5
            
            if #controls_width.positions < 1 then
                controls_width.positions[#controls_width.positions + 1] = {
                    text_title = response.title,
                    text_sub_text = response.sub_text,
                    title = 0,
                    sub_title = titleWidth + 20,
                    titleWidth = titleWidth,
                    textWidth = textWidth,
                }
            else
                local table = controls_width.positions[#controls_width.positions]
    
                if table then
                    controls_width.positions[#controls_width.positions + 1] = {
                        text_title = response.title,
                        text_sub_text = response.sub_text,

                        title = (table.sub_title + table.textWidth),
                        sub_title = (table.sub_title + table.textWidth) + titleWidth + 20,
    
                        titleWidth = titleWidth,
                        textWidth = textWidth,
                    }
                end
            end
        end
    end
end

