local __bigmapTarget = function(state)
    local render = function()

        local _, _, pRotation = getElementRotation(localPlayer)
        local cX, cY, _, fX, fY = getCameraMatrix()
        local cRotate = math.deg(math.atan2(fY - cY, fX - cX)) + 360 + 90

        if __GLOBAL.MAPIMAGE then
            local pPosition = {getElementPosition(localPlayer)}

            if isCursorShowing(localPlayer) and getKeyState('mouse1') then
                
                local cursorX, cursorY = getCursorPosition()
                local cursorX, cursorY = cursorX * __screen.size[1], cursorY * __screen.size[2]
                
                if not __oldCursorPosition then
                    __oldCursorPosition = {cursorX, cursorY}
                end

                if not __mapPosition then
                    __mapPosition = {0, 0}
                end

                if not __oldMapPosition then
                    __oldMapPosition = {__BIGMAP_MOVE[3], __BIGMAP_MOVE[4]}
                end

                __mapPosition = {__mapPosition[1] + cursorX - __oldCursorPosition[1], __mapPosition[2] + cursorY - __oldCursorPosition[2]} 

                __BIGMAP_MOVE[3], __BIGMAP_MOVE[4] = (__oldMapPosition[1] - (__mapPosition[1]  / __FX.mapZoom[1] )), (__oldMapPosition[2] + (__mapPosition[2]  / __FX.mapZoom[1] ))
                __FX.mapMoveX[2], __FX.mapMoveY[2] = __BIGMAP_ABSOLUTE_POSITION[1] + __BIGMAP_MOVE[3], __BIGMAP_ABSOLUTE_POSITION[2] + __BIGMAP_MOVE[4]

                __oldCursorPosition = {cursorX, cursorY}
            else
                __oldMapPosition = {__BIGMAP_MOVE[3], __BIGMAP_MOVE[4]}
                __mapPosition = false
                __oldCursorPosition = false
            end           
            
            __BIGMAP_MOVE[1], __BIGMAP_MOVE[2] = __FX.mapMoveX[1], __FX.mapMoveY[1]

            if getKeyState('space') then
                __BIGMAP_ABSOLUTE_POSITION = {pPosition[1], pPosition[2]}

                __FX.mapMoveX[2] = __BIGMAP_ABSOLUTE_POSITION[1]
                __FX.mapMoveY[2] = __BIGMAP_ABSOLUTE_POSITION[2]

                __oldMapPosition = false

                __BIGMAP_MOVE[3], __BIGMAP_MOVE[4] = 0, 0
                
                __mapPosition = false
                __oldCursorPosition = false
            end
        end
    end

    local assets = function()
        local pPosition = {getElementPosition(localPlayer)}

        dxSetRenderTarget(__BIGMAP_MAP_TARGET_ASSETS, true)
            -- RADAR AREA
            for _, radararea in pairs(getElementsByType('radararea')) do
                local rRound = getElementData(radararea, 'upcodes > radar area round') or false
                local rSize = {getRadarAreaSize(radararea)}
                local rColor = {getRadarAreaColor(radararea)} local rColor = __functions.rgb2hex(rColor[1], rColor[2], rColor[3])
                if rSize[1] > 1 and rSize[2] > 1 then
                    local bPosition = {getElementPosition(radararea)}

                    local radarX = (1904 / 2) + ((bPosition[1] + 3000) / (6000 / __MAP______SIZE)) 
                    local radarY = (1904 / 2) + ((-bPosition[2] + 3000) / (6000 / __MAP______SIZE))
    
                    if rRound then
                        __functions.round(false,
                            radarX, radarY - (rSize[1] / (6000 / __MAP______SIZE)),
                            (rSize[1] / (6000 / __MAP______SIZE)), (rSize[1] / (6000 / __MAP______SIZE)), (rSize[1] / (6000 / __MAP______SIZE)) / 2, 100, rColor, 0, rColor, 1.5
                        )
                    else
                        __functions.round(false,
                            radarX, radarY - (rSize[2] / (6000 / __MAP______SIZE)),
                            (rSize[1] / (6000 / __MAP______SIZE)), (rSize[2] / (6000 / __MAP______SIZE)), 2.5, 100, rColor, 0, rColor, 1.5
                        )
                    end
                end
            end

            -- GPS LINES

            local routes = __GLOBAL.LINE_of_GPS or {}
            for id, response in pairs(routes) do
                if routes[id + 1] then
                    local GpsX = ((routes[id][1] + 3000) / (6000 / __MAP______SIZE))
                    local GpsY = ((-routes[id][2] + 3000) / (6000 / __MAP______SIZE))
    
                    local GpsXX = ((routes[id + 1][1] + 3000) / (6000 / __MAP______SIZE))
                    local GpsYY = ((-routes[id + 1][2] + 3000) / (6000 / __MAP______SIZE))
    
                    
                    if id ~= (#routes - 1) then
                        dxDrawLine(
                            (1904 / 2) + GpsX,
                            (1904 / 2) + GpsY,
                            (1904 / 2) + GpsXX,
                            (1904 / 2) + GpsYY,
                            tocolor(__COLORS.gps_line[1], __COLORS.gps_line[2], __COLORS.gps_line[3], 240), __GLOBAL.interface.default_settings.gps.width
                        )
                        

                        dxDrawImage(
                            (1904 / 2) + GpsXX - ((__GLOBAL.interface.default_settings.gps.width - 1) / 2),
                            (1904 / 2) + GpsYY - ((__GLOBAL.interface.default_settings.gps.width - 1) / 2),
                            (__GLOBAL.interface.default_settings.gps.width),
                            (__GLOBAL.interface.default_settings.gps.width),
                            __SVG.point, 0, 0, 0, tocolor(__COLORS.gps_line[1], __COLORS.gps_line[2], __COLORS.gps_line[3], 240)
                        )

                    end

                    if id == (#routes - 1) then
                        dxDrawImage(
                            (1904 / 2) + GpsXX - (35 / 2),
                            (1904 / 2) + GpsYY - (35 / 2),
                            35,
                            35,
                            __SVG.loc, 0, 0, 0, tocolor(__COLORS.gps_line[1], __COLORS.gps_line[2], __COLORS.gps_line[3], 240)
                        )
                    end
                end
            end

            -- LOCAL NAME

            if __BIGMAP_ZOOM > 0.8 then
                for cName, pCity in pairs(__GLOBAL.locals_name.neighborhoods) do
                    local mapX = (1904 / 2) + ((pCity[1] + 3000) / (6000 / __MAP______SIZE)) 
                    local mapY = (1904 / 2) + ((-pCity[2] + 3000) / (6000 / __MAP______SIZE))

                    if __GLOBAL.interface.locals_name.neighborhoods[cName] then
                        local textWidth = dxGetTextWidth ( __GLOBAL.interface.locals_name.neighborhoods[cName], 1, __fonts.use('citys', 29))
        
                        __functions.text(false, __GLOBAL.interface.locals_name.neighborhoods[cName],
                            mapX, mapY,
                            textWidth, 19, 
                            tocolor(__COLORS.neighborhoods[1], __COLORS.neighborhoods[2], __COLORS.neighborhoods[3], 255), 1, __fonts.use('citys', 29), 'center', 'center'
                        )
                    end
                end
            end

            -- BLIPS

            if __GLOBAL.blip_settings.type == 'game_default' or __GLOBAL.blip_settings.type == 'element' then
                for _, element in pairs(getElementsByType('blip')) do
                    local bId = getBlipIcon(element)
                    local state = verifyBlipsAvailable(bId)
                    if state and bId ~= 0 then
                        local bPosition = {getElementPosition(element)}

                        local dist = getDistanceBetweenPoints2D(pPosition[1], pPosition[3], bPosition[1], bPosition[2])
                        if dist < __BIGMAP_LINE_DISTANCE then
                            local blipX = (1904 / 2) + ((bPosition[1] + 3000) / (6000 / __MAP______SIZE)) 
                            local blipY = (1904 / 2) + ((-bPosition[2] + 3000) / (6000 / __MAP______SIZE))
            
                            __functions.image(false,
                                blipX - ( (__BLIP_SIZE[1] / __BIGMAP_ZOOM) / 2 ), blipY - ( (__BLIP_SIZE[2] / __BIGMAP_ZOOM) / 2),
                                __BLIP_SIZE[1] / __BIGMAP_ZOOM, __BLIP_SIZE[2] / __BIGMAP_ZOOM, 
                                'assets/blips/' .. bId .. '.png', 0
                            )
                        end
                    end
                end
            end
        dxSetRenderTarget()
    end
        
    local peformaceMode = ((__BIGMAP_PEFORMACE_MODE == 'performance' and 20) or (__BIGMAP_PEFORMACE_MODE == 'intermediary' and 10) or (__BIGMAP_PEFORMACE_MODE == 'quality' and 5))

    if state == 1 then
        if isTimer(__bigmapTargetTimer) then
            killTimer(__bigmapTargetTimer)
        end

        __bigmapTargetTimer = __events.onTimer(render, __BIGMAP_PEFORMACE_TIME or peformaceMode, 0)
        __events.onTimer(assets, __BIGMAP_PEFORMACE_TIME or peformaceMode, 10)

        __bigmapTargetAssets = assets
    else
        if isTimer(__bigmapTargetTimer) then
            killTimer(__bigmapTargetTimer)
        end
    end
end

-- BIGMAP RENDER

local __BIGMAP_SETTINGS_MENU = {
    state = false,
}

local __bigmapRender = function()
    if __FX.fade[1] < 1 then return end
    
    if not __GLOBAL.MAPIMAGE then 
        __GLOBAL.MAPIMAGE = createMAPsvg()
        dxSetTextureEdge(__GLOBAL.MAPIMAGE, 'clamp')
    end

    -- PLAYER POSITION AND ROTATION
    
    local pPosition = {getElementPosition(localPlayer)}
    local pRotation = {getElementRotation(localPlayer)} local pRotation = pRotation[3]
    
    -- CAMERA ROTATION
    
    local pMatrix = {getCameraMatrix()} local cRotate = math.deg(math.atan2(pMatrix[5] - pMatrix[2], pMatrix[4] - pMatrix[1])) + 360 + 90
    local pCamera = {getElementRotation(getCamera())} local pCamera = pCamera[3]
    
    -- MAP POSITION

    local mPosition = {
        ((__BIGMAP_MOVE[1] + 3000) / (6000 / __MAP______SIZE)) - (mapSize[1] / __FX.mapZoom[1]) / 2, 
        ((-__BIGMAP_MOVE[2] + 3000) / (6000 / __MAP______SIZE)) - (mapSize[2] / __FX.mapZoom[1]) / 2,
    }
    
    -- RENDER BIGMAP 

    __functions.rectangle(false,
        __BIGMAP_POSITION[1], __BIGMAP_POSITION[2], __BIGMAP_POSITION[3], __BIGMAP_POSITION[4],
        tocolor(__COLORS.background[1], __COLORS.background[2], __COLORS.background[3], __FX.fade[1] / 1.2)
    )

    -- MAP IMAGE

    __functions.imagesection(false,
        0, 0, mapSize[1], mapSize[2], 
        mPosition[1], mPosition[2], 
        mapSize[1] / __FX.mapZoom[1], mapSize[2] / __FX.mapZoom[1], 
        __GLOBAL.MAPIMAGE, 0, 0, 0, tocolor(255, 255, 255, __FX.fade[1])
    )

    -- -- MAP BLIP ARROW

    local arrowX = mapSize[1] / 2 + (((-__BIGMAP_MOVE[1] + 3000) / (6000 / __MAP______SIZE)) - ((-pPosition[1] + 3000) / (6000 / __MAP______SIZE))) * __FX.mapZoom[1]
    local arrowY = mapSize[2] / 2 - (((-__BIGMAP_MOVE[2] + 3000) / (6000 / __MAP______SIZE)) - ((-pPosition[2] + 3000) / (6000 / __MAP______SIZE))) * __FX.mapZoom[1]


    if not __pulse then
        __pulse = getTickCount()
        __FX.arrow_pulse[2] = 255
    end

    if ((getTickCount() - __pulse) > 500) then
        __FX.arrow_pulse[2] = 0

        if ((getTickCount() - __pulse) > 1000) then
            __pulse = nil
        end
    end

    
    
    if __BIGMAP_MAP_TARGET_ASSETS and __BIGMAP_ASSETS and __FX.fade[2] > 200 then
        -- MAP BLIPS

        __functions.imagesection(false,
            0, 0, mapSize[1], mapSize[2], 
            (1904 / 2) + mPosition[1], (1904 / 2) + mPosition[2], 
            mapSize[1] / __FX.mapZoom[1], mapSize[2] / __FX.mapZoom[1], 
            __BIGMAP_MAP_TARGET_ASSETS, 0, 0, 0, tocolor(255, 255, 255, __FX.fade[1] - __FX.loading[1])
        )

        __functions.image(false,
            arrowX - ( __BLIP_SIZE[1] * __FX.mapZoom[1] ) / 2, arrowY - ( __BLIP_SIZE[2] * __FX.mapZoom[1] ) / 2,
            __BLIP_SIZE[1] * __FX.mapZoom[1], __BLIP_SIZE[2] * __FX.mapZoom[1], 
            'assets/arrow.png', math.abs(360 - pRotation), 0, 0, tocolor(255, 255, 255, __FX.fade[1] - __FX.arrow_pulse[1])
        )

        __functions.image(false,
            0, 0, mapSize[1], mapSize[2], 
            __BIGMAP_ASSETS, 0, 0, 0, tocolor(255, 255, 255, __FX.fade[1])
        )

        __functions.image(false,
            mapSize[1] / 2 - ( 180 *  __screen.scal) / 2, mapSize[2] / 2 - ( 180 *  __screen.scal) / 2, 180 *  __screen.scal, 180 *  __screen.scal, 
            __SVG.center, 0, 0, 0, tocolor(255, 255, 255, __FX.fade[1])
        )
    end
end


-- BIGMAP CLICK

__events.onClick(
    function(m, t)
        if m == 'left' and t == 'down' then
            local padding = 50
            local padding_w = 50
            
            local padding_auto = 0
            
            for id, response in pairs(__GLOBAL.blips_bigmap) do
                if id > __BIGMAP_MENU[3] and padding_auto < __BIGMAP_MENU_LIMIT then
                    local textWidth = dxGetTextWidth ( response.name, 1, __fonts.use('settings', 19))
                    if __functions.cursor(false,
                        __BIGMAP_POSITION[3] - textWidth - padding - ( padding_w - 15 ),
                        padding + (padding_auto * (padding_w - 20)) ,
                        textWidth + padding_w, padding_w - 25
                    ) then
                        if (__BIGMAP_MENU[1] + __BIGMAP_MENU[3]) ~= id then
                            __BIGMAP_MENU[1] = id
                            __BIGMAP_MENU[2] = 1
    
                            __events.onTimer(UpdateMENU, 2, 2)
                            __events.onTimer(__bigmapMenu, 2, 2)
                        end
                    end
                    
                    padding_auto = padding_auto + 1
                end
            end
    
            for id, response in pairs(__GLOBAL.interface.filters) do
                local padding_auto = ( id - 1 )
                local textWidth = dxGetTextWidth ( response.title, 1, __fonts.use('settings', 19))
    
                if __functions.cursor(false,
                    padding, padding + (padding_auto * (padding_w - 20)) ,
                    textWidth + padding_w + 15, padding_w - 25
                ) then
                    response.state = not response.state

                    __BIGMAP_MENU[1] = 0
                    __BIGMAP_MENU[2] = 1
                    __BIGMAP_MENU[3] = 0

                    triggerEvent('upcodes > update blips', localPlayer)

                    __events.onTimer(UpdateMENU, 2, 2)
                    __events.onTimer(__bigmapMenu, 2, 2)

                    UpdateMAP(__bigmapTargetAssets)
                end
            end
        end
    end
)

__events.onDoubleClick(
    function(button, cursorX, cursorY)
        if not __BIGMAP_STATE then return end

        if button == 'left' then
            __GLOBAL.LINE_of_GPS = {}

            local vehicle = getPedOccupiedVehicle(localPlayer)

            if getElementData(radarElementRoute, 'upcodes > map route') then 
                return setElementData(radarElementRoute, 'upcodes > map route', false)
            end

            local mapX = (cursorX / __FX.mapZoom[1] + (((__BIGMAP_MOVE[1] + 3000) / (6000 / __MAP______SIZE)) - (__BIGMAP_SIZE[1] / __FX.mapZoom[1] / 2))) * (3000 - (-3000)) / __MAP______SIZE + (-3000) 
            local mapY = (cursorY / __FX.mapZoom[1] + (((-__BIGMAP_MOVE[2] + 3000) / (6000 / __MAP______SIZE)) - (__BIGMAP_SIZE[2] / __FX.mapZoom[1] / 2))) * (-3000 - 3000) / __MAP______SIZE + (3000) 

            if vehicle then
                setElementData(vehicle, 'upcodes > map route', {mapX, mapY, 0})
                --triggerServerEvent('setRouteInJogadores', resourceRoot, localPlayer, vehicle, mapX, mapY)
            else
                setElementData(localPlayer, 'upcodes > map route', {mapX, mapY, 0})
            end
        end
    end
)

-- BIGMAP KEY 

__events.onKey(
    function(k, s)
        if s then
            if not __BIGMAP_VIEW then return end

            if __GLOBAL.interface.default_settings.key_open_bigmap ~= __GLOBAL.interface.default_settings.key_close_bigmap then
                if k == __GLOBAL.interface.default_settings.key_close_bigmap then
                    if __BIGMAP_STATE then
                        __BIGMAP_STATE = false
                        cancelEvent()
        
                        __GLOBAL.executes.close_bigmap()
        
                        local pPosition = {getElementPosition(localPlayer)}
        
                        __BIGMAP_ABSOLUTE_POSITION = {pPosition[1], pPosition[2]}
        
                        __FX.mapMoveX[2] = __BIGMAP_ABSOLUTE_POSITION[1]
                        __FX.mapMoveY[2] = __BIGMAP_ABSOLUTE_POSITION[2]
                    
                        showCursor(false)
                        triggerEvent('upcodes > bigmap open', localPlayer, 0)
                    end
                end
            end
            
            if k == __GLOBAL.interface.default_settings.key_open_bigmap then
                if not __BIGMAP_STATE then
                    __GLOBAL.executes.open_bigmap()
                
                    __BIGMAP_STATE = true
                    showCursor(true)
                    triggerEvent('upcodes > bigmap open', localPlayer, 1)
                    triggerEvent('upcodes > generate route', localPlayer, 'bigmap', 6000)
                    triggerEvent('upcodes > update blips', localPlayer)
                else
                    if __GLOBAL.interface.default_settings.key_open_bigmap == __GLOBAL.interface.default_settings.key_close_bigmap then
                        if __BIGMAP_STATE then
                            __BIGMAP_STATE = false
            
                            __GLOBAL.executes.close_bigmap()
            
                            local pPosition = {getElementPosition(localPlayer)}
            
                            __BIGMAP_ABSOLUTE_POSITION = {pPosition[1], pPosition[2]}
            
                            __FX.mapMoveX[2] = __BIGMAP_ABSOLUTE_POSITION[1]
                            __FX.mapMoveY[2] = __BIGMAP_ABSOLUTE_POSITION[2]
                        
                            showCursor(false)
                            triggerEvent('upcodes > bigmap open', localPlayer, 0)
                        end
                    end
                end
            end

            if not __BIGMAP_STATE then return end

            if k == __GLOBAL.interface.default_settings.key_mark_bigmap then

                if __deleyMark and getTickCount() - __deleyMark < 500 then return end
                if __deleyMark and getTickCount() - __deleyMark > 500 then __deleyMark = nil end
                if not __deleyMark then __deleyMark = getTickCount() end
                
                __GLOBAL.LINE_of_GPS = {}

                local vehicle = getPedOccupiedVehicle(localPlayer)
    
                if getElementData(radarElementRoute, 'upcodes > map route') then 
                    return setElementData(radarElementRoute, 'upcodes > map route', nil)
                end
    
                local mapX = (mapSize[1] / 2 / __FX.mapZoom[1] + (((__BIGMAP_MOVE[1] + 3000) / (6000 / __MAP______SIZE)) - (__BIGMAP_SIZE[1] / __FX.mapZoom[1] / 2))) * (3000 - (-3000)) / __MAP______SIZE + (-3000) 
                local mapY = (mapSize[2] / 2 / __FX.mapZoom[1] + (((-__BIGMAP_MOVE[2] + 3000) / (6000 / __MAP______SIZE)) - (__BIGMAP_SIZE[2] / __FX.mapZoom[1] / 2))) * (-3000 - 3000) / __MAP______SIZE + (3000) 
    
                if vehicle then
                    setElementData(vehicle, 'upcodes > map route', {mapX, mapY, 0})
                    --triggerServerEvent('setRouteInJogadores', resourceRoot, localPlayer, vehicle, mapX, mapY)
                else
                    setElementData(localPlayer, 'upcodes > map route', {mapX, mapY, 0})
                end

            end

            if k == 'mouse_wheel_up' then
                __BIGMAP_ZOOM = math.min(1, __BIGMAP_ZOOM + 0.1)
                __FX.mapZoom[2] = __BIGMAP_ZOOM
                UpdateMAP(__bigmapTargetAssets)
            elseif k == 'mouse_wheel_down' then
                __BIGMAP_ZOOM = math.max(0.4, __BIGMAP_ZOOM - 0.1)
                __FX.mapZoom[2] = __BIGMAP_ZOOM
                UpdateMAP(__bigmapTargetAssets)
            end

            if k == 'arrow_u' then
                if (__BIGMAP_MENU[1] +  __BIGMAP_MENU[3]) > 20 then
                    if __BIGMAP_MENU[3] > 0 then
                        __BIGMAP_MENU[3] = __BIGMAP_MENU[3] - 1
                    end
                else
                    if __BIGMAP_MENU[1] > 0 then
                        __BIGMAP_MENU[1] = __BIGMAP_MENU[1] - 1
                    end
                end
                __BIGMAP_MENU[2] = 1
                __events.onTimer(UpdateMENU, 5, 2)
                __events.onTimer(__bigmapMenu, 5, 2)
            elseif k == 'arrow_d' then
                if (__BIGMAP_MENU[1] + __BIGMAP_MENU[3]) < #__GLOBAL.blips_bigmap then
                    if __BIGMAP_MENU[1] < 20 then
                        __BIGMAP_MENU[1] = __BIGMAP_MENU[1] + 1
                    else
                        __BIGMAP_MENU[3] = __BIGMAP_MENU[3] + 1
                    end
                end
                __BIGMAP_MENU[2] = 1
                __events.onTimer(UpdateMENU, 5, 2)
                __events.onTimer(__bigmapMenu, 5, 2)
            elseif k == 'arrow_l' then
                if __BIGMAP_MENU[2] > 1 then
                    __BIGMAP_MENU[2] = __BIGMAP_MENU[2] - 1
                end
                __events.onTimer(UpdateMENU, 5, 2)
                __events.onTimer(__bigmapMenu, 5, 2)
            elseif k == 'arrow_r' then
                if __GLOBAL.blips_bigmap[__BIGMAP_MENU[1] + __BIGMAP_MENU[3]] and __BIGMAP_MENU[2] < #__GLOBAL.blips_bigmap[__BIGMAP_MENU[1] + __BIGMAP_MENU[3]].positions then
                    __BIGMAP_MENU[2] = __BIGMAP_MENU[2] + 1
                end
                __events.onTimer(UpdateMENU, 5, 2)
                __events.onTimer(__bigmapMenu, 5, 2)
            end
        end
    end
)

-- BIGMAP EVENT OPEN
addEventHandler('onClientVehicleEnter', root, 
    function(player)
        if player == localPlayer then
            radarElementRoute = source

            if __CLOSE_MINIMAP then
                triggerEvent('upcodes > generate route', localPlayer, 'minimap', 6000)
                __minimapTarget(1)
            elseif __BIGMAP_STATE then
                triggerEvent('upcodes > generate route', localPlayer, 'bigmap', 6000)
                __bigmapTarget(1)
            end
        end
    end
)

addEventHandler("onClientElementDestroy", getRootElement(),
    function ()
        if getElementType(source) == 'vehicle' and getPedOccupiedVehicle(localPlayer) == source then
            radarElementRoute = localPlayer
            setElementData(source, "upcodes > map route", false)
        end
    end
)

addEventHandler('onClientVehicleExit', root, 
    function(player)
        if player == localPlayer then
            radarElementRoute = localPlayer

            __GLOBAL.LINE_of_GPS = {}

            if isTimer(minimapGPS_route) then
                killTimer(minimapGPS_route)
            end

            if __CLOSE_MINIMAP then
                triggerEvent('upcodes > generate route', localPlayer, 'minimap', 6000)
                __minimapTarget(1)
            elseif __BIGMAP_STATE then
                triggerEvent('upcodes > generate route', localPlayer, 'bigmap', 6000)
                __bigmapTarget(1)
            end
        end
    end
)


addEventHandler('onClientElementDataChange', root,
    function(key, _, data)
        if (source == radarElementRoute) and key == 'upcodes > map route' then
            if __CLOSE_MINIMAP then
                triggerEvent('upcodes > generate route', localPlayer, 'minimap', 6000)
                __minimapTarget(1)
            elseif __BIGMAP_STATE then
                triggerEvent('upcodes > generate route', localPlayer, 'bigmap', 6000)
                __bigmapTarget(1)
            end
        end
    end
)


__events.onEvent('upcodes > bigmap open', root,
    function(state)
        if not __BIGMAP_VIEW then return end

        toggleControl('radar', false )
        if state == 1 then
            
            if not __events.isEvent('onClientRender', root, __bigmapRender) then
                DefineOptionsBigmap()
                __events.onPreRender(__bigmapPreRender)
                __events.onRender(__bigmapRender)
            end
            
            __FX.fade[2] = 255
            __bigmapTarget(1)
            triggerEvent('upcodes > minimap open', localPlayer, 0)
            __events.onTimer(__bigmapMenu, 10, 10)
        else
            __FX.fade[2] = 0
            __bigmapTarget(0)
            triggerEvent('upcodes > minimap open', localPlayer, 1)
        end
    end
)

addEventHandler('onClientResourceStop', root, 
    function(resource)
        if resource ~= getThisResource() then return end
        toggleControl('radar', true )
    end
)

function bigmapView(element, state)
    if state then
        if state == 'off' then
            
            if not __BIGMAP_STATE then return end
            __BIGMAP_STATE = false
            
            __GLOBAL.executes.close_bigmap()
            
            showCursor(false)
            triggerEvent('upcodes > bigmap open', element or localPlayer, 0)
            
            __BIGMAP_VIEW = false

        else
            __BIGMAP_VIEW = true
        end
    else
        error('@'..getResourceName(getThisResource())..': argumento 1 deve ser "on" ou "off"!')
    end
end
__events.onEvent('upcodes > bigmap view', root, bigmapView)

function createRoute(element, route)
    if getElementType(element) == 'player' or getElementType(element) == 'vehicle' then
        if type(route) == 'table' then
            if tonumber(route.x) and tonumber(route.y) then

                __GLOBAL.LINE_of_GPS = {}
            
                if getElementData(element, 'upcodes > map route') then 
                    setElementData(element, 'upcodes > map route', false) return false
                end
            
                setElementData(element, 'upcodes > map route', {route.x, route.y, route.z or 0})

                return true
            end
        else
            error('@'..getResourceName(getThisResource())..': argumento 2 não é uma tabela!')
        end
    else
        error('@'..getResourceName(getThisResource())..': argumento 1 não é "player" ou "veiculo"!')
    end
end
__events.onEvent('upcodes > createRoute', root, createRoute)

